svg.script:
// Web Audio APIの初期化
const audioContext = new (window.AudioContext || window.webkitAudioContext)();
let audioBuffer = null;
let audioSourceNode = null;
let isPlaying = false;

// 外部MP3ファイルのURL
const mp3Url = 'data:audio/mpeg;base64,';  // 実際のMP3ファイルURLに置き換えてください

// コード実行時に自動的に再生開始
function playMP3() {
    // オーディオファイルをフェッチしてデコード
    fetch(mp3Url)
        .then(response => response.arrayBuffer())   // MP3ファイルをバイナリとして取得
        .then(data => audioContext.decodeAudioData(data)) // デコードしてaudioBufferに格納
        .then(buffer => {
            // デコードしたオーディオバッファを使って再生
            audioBuffer = buffer;
            playAudio();
        })
        .catch(error => console.error('音声の読み込みエラー:', error));
}

// 音声を再生する関数
function playAudio() {
    // バッファソースノードを作成
    audioSourceNode = audioContext.createBufferSource();
    audioSourceNode.buffer = audioBuffer;

    // スピーカーに接続
    audioSourceNode.connect(audioContext.destination);

    // 再生開始
    audioSourceNode.start(0);
    isPlaying = true;

    // 再生終了時にリソースを解放
    audioSourceNode.onended = () => {
        isPlaying = false;
    };
}

// ここでMP3を再生する
playMP3();
